import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.png';
import Typewriter from '../Typewriter/typewriter';
import { ReactTyped } from 'react-typed';

function Home(){
  return (
    <section id="intro">
      <div className="rectbox">
        <div className="imgcontainer">
        <img src={imgme} alt="Me" className="photoofme" />
        </div>
        <span className="nameinbox"><Typewriter text="RUDRAKSHA SINGH" delay={73}></Typewriter></span>
      </div>
      <div className="hometext">A web developer focused on front-end design <br/>and building clean, responsive interfaces. 
      <br/>Constantly learning and expanding my skill set, <br/>with a solid foundation in data structures <br/>and algorithms to ensure efficient code. 
      <ReactTyped strings={["My React App"]} typeSpeed={100} loop /> 
      {/* <br/><Typewriter text=" " delay={100}></Typewriter> */}
      </div>
    </section>
  );
}

export default Home;
